  "advertisements": [
    {
      "date": null,
      "tags_section": null,
      "ntokens": 14,
      "text": "26. Bey Hrn. Rudolf Ramsperger an der Huths gass ist extra guter Holländ. Taback in blauen Pfund-Büchsen à 10 Batzen, wie auch guter St. Vincent à 8 Bz. zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 16,
      "text": "27. Wo gute alte grosse Bohnen zum Sezen, und kleine weisse dito zum Kochen in billigem Preis zu haben, ist im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 17,
      "text": "28. Zween Barrellein oder Professor Huth, wie auch ein ganz neuer Caistor Huth, mittl. inl. Grösse, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 20,
      "text": "29. Bey Hrn. Burkhardt zum Riesen sind extra neue grosse Italienische Feigen, dito grosse Meer-Trauben mit und ohne Stiel, Haselnüsse, birre Morcheln, feine Chocoladen, alles in billigem Preis zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 13,
      "text": "30. Zwölf Sack neuer Waizen in billigem Preis, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 28,
      "text": "31. Bey Hrn. Jacob Grimm Buchbinder ist zu haben: 1) Ein Kriegs-Atlas von 65 theils Land-Karten, Stäben, Plänen von Bataillen und Belagerungen des jetzigen Kriegs. 2) Die Welt in einer Nuss mit Kupfern. 3) Die Durchlauchige Welt, 4 Theil mit Waapen. 4) Journal du Camp de Compiègne avec figures."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 20,
      "text": "32. Fünfe schöne frantzösische Bether in ein Wirthshaus auf das Land oder in ein Bad dienlich, ohnentgeltlich in Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 26,
      "text": "33. Ein Behaußung in der Reßchauer Vorstadt mit 4 Stuben, 5 Kammern samt einer schönen geöbten Keller und Garten, weßhalb sich bey Hrn. Jacob Mäglin dem Weinmann anzumelden."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 23,
      "text": "34. Ein Freund, welcher circa 600 Sefter Hanfs Saamen andere leuffern tonte, möchte aber folchen vorhero verkaufft wissen, offeriert selbigen dahero in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 17,
      "text": "35. Wo guter alter weisser Wein zu haben, ist bey Hrn. Michael Fuchs dem Küfer zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 16,
      "text": "36. Circa 6. Saumt erica guter alter rother Pfäntzer-Wein, so gut als Neuenburger oder Burgunder, in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 19,
      "text": "37. Zween Stücklein weissen Wein von 1760, à 8 Pfund to 8 der Saumt im einen, und à 8 Pfund im andern, wovon nach Belieben zu haben, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 20,
      "text": "38. Ein Stock Hey so ab 3 Tannen Matten vorr Nichmeyer; Thor oberhalb der Schorenmatt, ferner ein Stücklein von 37 Saumen rothes Hölzern-Wein von 1760, schon roth- und lauter, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 16,
      "text": "39. Auf E. E. Zunfft zum Bären sind wiederum einige saure Rüben in billigem Preis zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 17,
      "text": "40. Ein roth Scharlachen Camisol und Hofen in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 13,
      "text": "41. Im Offenburger Hof ist wohlfeilerer Bau zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 15,
      "text": "42. Ein Brennhaußlein bey der Steinen-Mühlin mit aller Kommodität, im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 23,
      "text": "43. Bey weme rother und weisser Burgunder, wie auch Muscat-Wein, Piecenweiß, weisser Mangel-Piages, wie auch roth und weisser 7säzger Margraffer-Wein in billigem Preis zu haben, ist im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 19,
      "text": "44. Feine heitergelbe Hamburger-Strick-Wollen das Pfund à 6 Pfund, wo dieselbe Pfundweis zu haben, ist im Berichthaus ohne Entgeld zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 25,
      "text": "45. Herrn Holzach des Siegfrists Behaußung ins Spieg-Ißgäßlein mit 4 Stuben, 3 Kammern etc. ist entweder zu verkauffen, oder samt dem Haus zu verlehnen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 16,
      "text": "46. Weisse und rothe Margraffer-Weine von 1760, wovon nach Belieben zu haben, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 17,
      "text": "47. Ein Mannsbild in St. Peters Kirch auf dem Lettern. Item ein grün Tombau-Blechlein mit grünen wollenen Umhängen, in Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 18,
      "text": "48. Ein Hausschlitten mit einem schönen Bild und Zugehör in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "ntokens": 18,
      "text": "49. Der Barenfelßer-Hof zu St. Peter, mit Garten, Stallung, Keller etc. wie der Augen schein zeiget wird. In Ermangelung eines Käuffers"
    }
  ]
}
